import React from "react";

const QuoteCard = () => {
  return (
    <div className="single-quote">
      <ul>
        <li>
          <div className="company"></div>
        </li>
        <li>Price</li>
        <li>Benefits</li>
        <li>Actions</li>
        <li>Compare</li>
      </ul>
    </div>
  );
};

export default QuoteCard;
